import React, { useState } from "react";

const Toggle = () => {
  const [isVisible, setIsVisible] = useState("Hello");
  return (
    <div>
      <h1>Toggle Component</h1>
      {isVisible}
      <button onClick={() => setIsVisible("Goodbye")}>Toggle Visibility</button>
    </div>
  );
};

export default Toggle;
